import React, { Component } from "react";
import { connect } from "react-redux";
import { addVehicle } from "../Redux/Action";

class ViewAllVehicles extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <table>
        <tbody>
          {this.props.data.map(vehicle => {
            <tr>
              <td>{vehicle.model_name}</td>
              <td>{vehicle.top_speed}</td>
            </tr>;
          })}
        </tbody>
      </table>
    );
  }
}

const mapStateToProps = state => {
  return {
    data: state.data
  };
};
const mapDispatchToProps = dispatch => {
  return {
    addVehicle: vehicle => dispatch(addVehicle(vehicle))
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(ViewAllVehicles);
